import React from 'react';
import styles from './Skills.module.css';
import ReactComponent from "./Skill";
import Title from "../BlockTitles/Title";
import Fade from "react-reveal/Fade";
// import JS from './../assets/images/javascript-iconsvg.svg'
import ReactImage from './../assets/images/React native.svg'
import HTMLImage from './../assets/images/html-5.svg'
// import CSSImage from './../assets/images/Css.svg'
// import CSSImage from './../assets/images/css-3.svg'


function Skills() {
    let skills = [
        {title:'React', image: ReactImage},
        {title:'HTML', image: HTMLImage},
        {title:'CSS', image: CSSImage},
        {title: 'JS', image: JS}
        ];
    let title = 'My skills';
    return (
        <div id={'skills'} className={styles.skills}>
            <Fade bottom>
                <div className={styles.container}>
                    <Title title={title}/>
                    <div className={styles.wrapper}>
                        {skills.map(s => {
                            return <ReactComponent skill={s}/>
                        })}
                    </div>
                </div>
            </Fade>
        </div>
    );
}

export default Skills;
